window.bookSummaryJSON = "<p><b>Hell is not a place, but an experience, one that Kisa just can't seem to escape. Fate is fickle, after all.... You can't fight fate....</b></p> <p>With the prophecy barreling towards them, Kisa and Dolor must fight against heaven itself for their survival. But can she trust him enough to work by his side? The more she learns about Dolor, the less certain she becomes about her feelings and her future, but time isn't a luxury they can afford.</p> <p>As they track down the lost Fates, pieces of the puzzle begin to line up. Love and deception. Secrets and truth. Lust and acceptance. One thing is certain, though - Kisa and Dolor will do everything in their power to stop the destruction that seems inevitable.</p> <p>New friends and old will come together, and tragedy and hope will collide in the epic conclusion of the Slivered Souls Trilogy.</p> <p><b>Contains mature themes.</b></p>"; 
